import{_ as e,c as a,o as t,e as s}from"./app.1d9aafb3.js";const m=JSON.parse('{"title":"Gate 3 Vykas","description":"","frontmatter":{"title":"Gate 3 Vykas"},"headers":[{"level":2,"title":"Preparation","slug":"preparation"},{"level":2,"title":"170 HP Swamp","slug":"_170-hp-swamp"},{"level":2,"title":"150 HP Sword and clones","slug":"_150-hp-sword-and-clones"},{"level":2,"title":"135 HP Boomer test","slug":"_135-hp-boomer-test"},{"level":2,"title":"120 HP Throne","slug":"_120-hp-throne"},{"level":2,"title":"105 HP Stagger Check","slug":"_105-hp-stagger-check"},{"level":2,"title":"75 \u2002HP Swamp","slug":"_75-hp-swamp"},{"level":2,"title":"55 \u2002HP Tentacles","slug":"_55-hp-tentacles"},{"level":2,"title":"40 \u2002HP Release orbs","slug":"_40-hp-release-orbs"},{"level":2,"title":"0 \u2002\u2002HP Final stagger","slug":"_0-hp-final-stagger"}],"relativePath":"vykas/gate3.md","lastUpdated":1657448064000}'),r={name:"vykas/gate3.md"},o=s(`<h1 id="gate-3-vykas-hard-mode" tabindex="-1">Gate 3 Vykas <code>--Hard Mode--</code> <a class="header-anchor" href="#gate-3-vykas-hard-mode" aria-hidden="true">#</a></h1><p>Table of content</p><nav class="table-of-contents"><ul><li><a href="#preparation">Preparation</a><ul></ul></li><li><a href="#_170-hp-swamp">170 HP Swamp</a></li><li><a href="#_150-hp-sword-and-clones">150 HP Sword and clones</a></li><li><a href="#_135-hp-boomer-test">135 HP Boomer test</a></li><li><a href="#_120-hp-throne">120 HP Throne</a></li><li><a href="#_105-hp-stagger-check">105 HP Stagger Check</a></li><li><a href="#_75-hp-swamp">75 \u2002HP Swamp</a></li><li><a href="#_55-hp-tentacles">55 \u2002HP Tentacles</a></li><li><a href="#_40-hp-release-orbs">40 \u2002HP Release orbs</a></li><li><a href="#_0-hp-final-stagger">0 \u2002\u2002HP Final stagger</a></li></ul></nav><h2 id="preparation" tabindex="-1">Preparation <a class="header-anchor" href="#preparation" aria-hidden="true">#</a></h2><h4 id="items" tabindex="-1">Items: <a class="header-anchor" href="#items" aria-hidden="true">#</a></h4><p>HP potion sleep grenade stagger grenade time stop</p><h4 id="ester" tabindex="-1">Ester <a class="header-anchor" href="#ester" aria-hidden="true">#</a></h4><p>Use Nineveh to push damage when ester meter is full</p><p>Save ester meter closer to the end to use wei at last stagger check</p><h4 id="positions" tabindex="-1">Positions <a class="header-anchor" href="#positions" aria-hidden="true">#</a></h4><p>Party 1 goes left</p><p>Party 2 goes right</p><div class="language-"><span class="copy"></span><pre><code><span class="line"><span style="color:#A6ACCD;">For medusa (following party number)</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span>
<span class="line"><span style="color:#A6ACCD;">Party 1 goes 1st</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span>
<span class="line"><span style="color:#A6ACCD;">Party 2 goes 2nd</span></span>
<span class="line"><span style="color:#A6ACCD;"></span></span></code></pre></div><h4 id="notes" tabindex="-1">Notes <a class="header-anchor" href="#notes" aria-hidden="true">#</a></h4><h2 id="_170-hp-swamp" tabindex="-1">170 HP <strong>Swamp</strong> <a class="header-anchor" href="#_170-hp-swamp" aria-hidden="true">#</a></h2><p>2 people with slow buff put them in sequence at 9 o&#39;clock</p><p>rest stay near and just to the furthest slow ground</p><blockquote><p>Good dps slot for ranged classes</p></blockquote><h2 id="_150-hp-sword-and-clones" tabindex="-1">150 HP <strong>Sword and clones</strong> <a class="header-anchor" href="#_150-hp-sword-and-clones" aria-hidden="true">#</a></h2><p>You need at least 1 person with &gt;70% of lust meter, ping all the locations of the swords</p><p>Go to position where sword and clone overlaps</p><h2 id="_135-hp-boomer-test" tabindex="-1">135 HP <strong>Boomer test</strong> <a class="header-anchor" href="#_135-hp-boomer-test" aria-hidden="true">#</a></h2><p>Everyone should run to pre determined cleansing orb and clear their lust meter</p><p>Win simple input mini game</p><blockquote><p>Good place to use Nineveh after minigame</p></blockquote><h2 id="_120-hp-throne" tabindex="-1">120 HP <strong>Throne</strong> <a class="header-anchor" href="#_120-hp-throne" aria-hidden="true">#</a></h2><p>Stack up in the middle and fill up <span style="color:red;"> lust bar </span></p><h2 id="_105-hp-stagger-check" tabindex="-1">105 HP <strong>Stagger Check</strong> <a class="header-anchor" href="#_105-hp-stagger-check" aria-hidden="true">#</a></h2><p>Use second cleansing orb to cleat lust bar</p><p>Run to the middle and stagger the boss (don&#39;t use wei)</p><p>Use timestop potion when large frog will start glowing red, most of t he time its right after passing stagger check</p><h2 id="_75-hp-swamp" tabindex="-1">75 \u2002HP <strong>Swamp</strong> <a class="header-anchor" href="#_75-hp-swamp" aria-hidden="true">#</a></h2><p>Repeat mechanic <strong>Swamp</strong> from <a href="#_170-HP-swamp">170 HP bar</a></p><h2 id="_55-hp-tentacles" tabindex="-1">55 \u2002HP <strong>Tentacles</strong> <a class="header-anchor" href="#_55-hp-tentacles" aria-hidden="true">#</a></h2><p>It&#39;s good to save awakening for this phase</p><p>Tank red orbs flying from the middle until you have &gt;70% of the lust meter indicated by split on its bar, do not overdue it and get mind controlled</p><p>Destroy tentacles, you will need &gt;70% of lust meter to damage them.</p><p>Start by killing at your spot then run to help others</p><h2 id="_40-hp-release-orbs" tabindex="-1">40 \u2002HP <strong>Release orbs</strong> <a class="header-anchor" href="#_40-hp-release-orbs" aria-hidden="true">#</a></h2><p>4 orbs will spawn at 2/4/8/11 o&#39;clock 4 players with lowest lust bar must take the orbs and spam &#39;space&#39; afterwards to get free</p><h2 id="_0-hp-final-stagger" tabindex="-1">0 \u2002\u2002HP <strong>Final stagger</strong> <a class="header-anchor" href="#_0-hp-final-stagger" aria-hidden="true">#</a></h2><p>Locate vykas on the minimap and face her ( away from the clone in the middle)</p><p>After medusa mech is over run behind vykas</p><blockquote><p>Good time to use Wei</p></blockquote>`,44),n=[o];function l(h,i,p,d,c,g){return t(),a("div",null,n)}var f=e(r,[["render",l]]);export{m as __pageData,f as default};
